import React from 'react';
import Header from './header/header';
import Main from './main/main';
import './admin.css';


function Admin() {
  return (
     <div className="admin">
<Header/>
<Main/>

<Routes>
                <Route path="/Admin" element={<Admin/>} />
                <Route path="/" element={<Home/>} />
                <Route path="/About" element={<About/>} />
              </Routes>

    </div>
  );
}

export default Admin;
